import Grid from "react-bootstrap/es/Grid";
import ResultsTable from "./ResultsTable"


const Report = () => (
  <Grid>
    <h1>Report Page</h1>

    <div class="box">
        <Card>Hello</Card>
    </div>

    <div class="box">
        <Card>Hello</Card>
    </div> 
    <br />

   
  </Grid>
);

export default Report;
